import uleebalang from "../assets/images/uleebalang.jpeg";

export default materi = [
  {
    gambar: { uleebalang },
    judul: "1. Ulee Balang (Aceh)",
    isi: "Pakaian adat Aceh dikenal dengan nama Ulee Balang. Bentuk pakaian ini dipengaruhi oleh kebudayaan Melayu dan Islam. Dilansir dari laman maa.acehprov.go.id, pakaian adat Aceh ini awalnya selalu memakai bahan baku dari kain yang ditenun sendiri, baik dari sutera atau dari bahan kapas.",
  },
  {
    gambar: "../../assets/images/uleebalang.jpeg",
    judul: "2. Ulos (Sumatera Utara)",
    isi: "Pakaian adat Aceh dikenal dengan nama Ulee Balang. Bentuk pakaian ini dipengaruhi oleh kebudayaan Melayu dan Islam. Dilansir dari laman maa.acehprov.go.id, pakaian adat Aceh ini awalnya selalu memakai bahan baku dari kain yang ditenun sendiri, baik dari sutera atau dari bahan kapas.",
  },
];
